) написал:
«Мяне спынілі супрацоўнікі ДАІ Валожынскага раёна каля вёскі Суднікі.

Ехаў на участак галасаваць. Зараз вязуць на праверку алкагольнага стану ў Валожын. Ціпа ёсць падазрэнні ў іх што я п’яны.»

).

Устаноўленым ДАІшнікам будзе пагражаць вечар у хату па ч.3 арт. 426 КК РБ: ад 3 да 10. 

Крыніцы канала таксама нагадваюць, што ўсім пацярпелым ад дзеянняў "праваахоўнікаў" 9-12 жніўня варта неадкладна падаваць заявы ў пракуратуру, СК і міліцыю.

Друзья, наступает время перемен и создания новой Беларуси. Каждый и каждая из нас сегодня влияет на судьбу страны. Мы объединяем все стачкомы (забастовочных комитетов) всех предприятий страны.

Каждое предприятие выдвигает одного представителя в Национальный забастовочный комитет, который координирует наши общие усилия.

ВАЖНО! Форма только для представителей стачкомов (забастовочных комитетов) предприятий. Все кто хочет присоединиться к забастовкам - организуйте на предприятии стачком и присоединяйтесь к движению.

ЦЕЛИ И ТРЕБОВАНИЯ:
- стоп милицейскому насилию;
- свободу политзаключенным и манифестантам;
- отставка Лукашенко;
- власть Тихановской.

СОЛИДАРНОСТЬ СИЛЬНЕЕ РЕПРЕССИЙ, РАБОТАЕМ ДАЛЬШЕ ДЛЯ НОВОЙ БЕЛАРУСИ!

Оргкомитет национального стачкома.

⚡️На сегодняшний день тема выражения своей позиции является актуальной не только среди каждого отдельного гражданина, но и среди трудовых коллективов.

При этом, важно всему обществу действовать в соответствии с законодательством.

Одним из легальных правовых механизмов выражения позиции трудового коллектива является забастовка.

Команда REVERA готова помочь в консультировании по общим вопросам проведения забастовки, в том числе по следующим вопросам:
1) что такое забастовка и какие требования могут быть выдвинуты в рамках забастовки;
2) риски, связанные с объявлением забастовки для работника и нанимателя (ответственность);
3) что происходит с работой во время проведения забастовки;
4) порядок проведения забастовки и её документальное оформление (с предоставлением шаблонов необходимых документов);
5) действия нанимателя при проведении забастовки;
6) права и обязанности работника при проведении забастовки;
7) последствия участия работника в забастовке;
8) последствия отказа работника от участия в забастовке.

Также адвокаты готовы предоставить формы документов, оформление которых необходимо для законного проведения забастовки.

📍Контактные данные для связи:
Татьяна -

⚡️Забастовки угрожают стране куда меньше, чем нам пытаются доказать;
⚡️Хорошо себя будет чувствовать разве что бизнес, который продает хлеб и молоко. Может, еще и колбасы;
⚡️У банков проблемы с ликвидностью – а это паршиво;
⚡️«Печатный станок» уже включили.

Более подробно разбираем ситуацию с экспертом тут:

Один из создателей фонда, активист Андрей Стрижак пишет: «В эти дни усиленно разгребаем коммуникационные завалы. Отстроили работу департаментов и теперь нуждаемся в рабочих руках. СРОЧНО И МНОГО». 

Что нужно делать: 

- автоматизация обработки заявок;
- ручная обработка заявок;
- ведение соцсетей.

Андрей уточняет: «Это не закрытый список. Если у вас есть еще идеи как вы можете помочь фонду и Национальному забастовочному комитету, заполняйте

 Палаты представителей, которые не высказывают своего мнения и позиции;

✅ Инициируем процедуру отзыва всех депутатов местных советов;

✅ Мы продолжаем требовать новых выборов президента, парламента, и местных советов

✅

Зафиксировав несколько десятков тысяч нарушений на выборах, белорусы услышали от Ермошиной и других прикорытников традиционное «что-то не нравится – идите в суд». Сходили:

❌ Прокуратура любые жалобы на выборы перенаправляет в избирательные комиссии (те самые, которые с бандитской наглостью украли ваши голоса);

❌ Милиция и следователи отказываются возбуждать уголовные дела по фальсификации выборов, ссылаясь на то что избирательными комиссиями нарушений не выявлено;

❌Верховный Суд отказывается принимать жалобы на решения ЦИК.

) объяснять ситуацию коллективу.

Хочется верить, что коллектив объяснит И.О. министра Пиневичу всё что думают про прислужников кровавого режима. 
Если будет видео/фото - присылайте в бота.

Калектыў Нацыянальнага гістарычнага архіва Беларусі занепакоены падзеямі, якія адбываюцца ў апошнія дні ў нашай краіне. Ужыванне гвалту ў дачыненнні мірных грамадзян і масавыя затрыманні пасля 9 жніўня 2020 г. не маглі пакінуць абыякавымі работнікаў архіва. У ліку затрыманых аказаліся нашы калегі навукоўцы, работнікі сферы культуры і адукацыі, у тым ліку карыстальнікі чытальных залаў архіва, сваякі і блізкія многіх супрацоўнікаў. 

Паколькі ўсе слаі беларускага грамадства зацікаўлены ў падтрыманні правапарадку і захавання законнасці, мы заклікаем кіраўніцтва краіны:

– забяспечыць грамадзянам захаванне правоў і свабод, гарантаваных Канстытуцыяй Рэспублікі Беларусь, у прыватнасці, свабоду сходаў, мітынгаў, вулічных шэсцяў, дэманстрацый і пікетавання, якія не парушаюць правапарадак і правы іншых грамадзян Рэспублікі Беларусь, а таксама права на атрыманне, захаванне і распаўсюджванне поўнай, дакладнай і своечасовай інфармацыі; 

– даць прававую ацэнку парушэнням, дапушчаным у ходзе выбарчай кампаніі; 

– вызваліць з месцаў прымусовага ўтрымання ўдзельнікаў акцый пратэста, затрыманых пасля 9 жніўня 2020 г., і забяспечыць аб'ектыўны і неперадузяты разгляд іх спраў; 

– спыніць ужыванне гвалту з боку прадстаўнікоў органаў правапарадку і, у прыватнасці, выкарыстання спецсродкаў у дачыненні да мірных дэманстрантаў і журналістаў; 

– правесці расследаванне і даць прававую ацэнку фактам збіцця удзельнікаў акцый пратэста і гвалту у дачыненні асоб, затрыманых за ўдзел у іх, а таксама дзеянням, якія прывялі да гібелі дэманстрантаў. 

Гэтыя захады дазволяць пазбегнуць далейшага росту напружанасці і будуць спрыяць устанаўленню ў беларускім грамадстве атмасферы дыялога і ўзаемаразумення. 

Як захавальнікі шматвекавой дакументальнай спадчыны нашага народа, перакананы, што ацэнку дзеянняў усіх бакоў любых канфліктаў заўсёды дае аб'ектыўны і неперадузяты суд Гісторыі. Лёс кожнага грамадзяніна важны для будучыні ўсёй краіны.

КТО ПОДПИСАЛ?

Среди подписантов письма чемпионы мира и Европы, олимпийские призеры, заслуженные мастера спорта:

- Андрей Кравченко;
- Дмитрий Асанов;
- Степан Попов;
- Александра Герасименя;
- Наталья Лещик;
- Эльвира Герман;
- Марина Арзамасова;
- Анна Гуськова;
- Александра Романовская;
- Елена Левченко.

НА ЧТО ГОТОВЫ СПОРТСМЕНЫ?

«В случае появления информации о попытках давления, угроз увольнения или нарушениях прав представителей спорта, подписавшихся под этим письмом, все спортсмены будут действовать солидарно, вплоть до возможного отказа от выступления за национальную сборную страны, или отказа от организации международных и национальных спортивных мероприятий. Кроме того, данные факты незамедлительно будут направлены в МОК, международные спортивные федерации и комитеты», – говорится в заявлении.

КТО ПОМОЖЕТ СПОРТСМЕНАМ?

Создан BSSF/Belarusian Sport Solidarity Foundation, который помогает спортсменам которые были уволены за свои убеждения. Выплаты уволенным спортсменам производятся из общего сбора Фонд солидарности BYSOL/Belarus solidarity foundation.

КАК ПОМОЧЬ СПОРТСМЕНАМ?

